script:
///$tab Main
//Deutsche Einstellungen
SET ThousandSep='.';
SET DecimalSep=',';
SET MoneyThousandSep='.';
SET MoneyDecimalSep=',';
SET MoneyFormat='#.##0,00 €;-#.##0,00 €';

//Englische Einstellungen. Achtung: wegen Problem mit dem Data Market funktioniert die Self-Service-Demo, 
//wenn man die Währungs-Umtauschkurse aus dem Data Market lädt, NUR mit den englischen Einstellungen hier 
//im Data Load Script. Daher VOR der Self-Service-Demo hier die englischen Einstellungen einkommentieren
//und die deutschen auskommentieren.
// SET ThousandSep=',';
// SET DecimalSep='.';
// SET MoneyThousandSep=',';
// SET MoneyDecimalSep='.';
// SET MoneyFormat='#,##0.00 €;-#,##0.00 €';

SET TimeFormat='hh:mm:ss';
SET DateFormat='DD.MM.YYYY';
SET TimestampFormat='DD.MM.YYYY hh:mm:ss[.fff]';
SET MonthNames='Jan;Feb;Mär;Apr;Mai;Jun;Jul;Aug;Sep;Okt;Nov;Dez';
SET DayNames='Mo;Di;Mi;Do;Fr;Sa;So';

LET vMapVersion = 'Static'; // SVG, Static, OSM, Google, Google Ext

LET vDotColor = 'LandColor';
LET vTodaysDate = Today();
LET Today = '2018-12-20';
LET vStartPY = '2017-01-01';
LET YTD_new = MakeDate(2008, 12, 12);
SET v2YTD = '=num(max(OrderDate))-730';//ich denke, die wird nicht mehr gebraucht
SET vYTD = '=num(max(OrderDate))-365';//ich denke, diese Variable wird nichtmehr gebraucht

SET vMaxOrderDate = '=max(OrderDate)';
SET vCY = 2018;
SET vPY = 2017;
SET vAddYears = 1;

SET vDarkGrey = RGB(95,96,98);
SET vBlue = RGB(119,133,184);
SET vQVGreen = RGB(97,167,41);
SET vLightGreen = RGB(196,214,0);
SET vLightYellow = RGB(255,237,147);
SET vGreen = RGB(76,140,43);
SET vYellow = RGB(255,199,44);
SET vOrange = RGB(248,152,29);
SET vLightGrey = RGB(159,161,164);

SET vKPI = 'Umsatz';
set vKPI1= 'Umsatz';//Warum hab ich hier Umsatz und nicht Kosten genommen???
SET vKPI2 = 'Absatz';
Let vReport = 'C';












///$tab Custom Report
DIMENSIONS:
LOAD * INLINE [
DimensionArea,	Dimension,	DimensionNo,	DimensionDescriptionPopUp
Customer, Customers.Land, 1, "z.B. DE"
Customer, Customer,  2, "Firmenname"
Product,  Category Name, 3, 	"Produktkategorie"
Product,  Product Name, 4, "Produktname"
];

KPIS:
LOAD * INLINE [
MetricType, Metric, MetricNo, 	MetricFormula, MetricDescriptionPopUp
Booking,  Umsatz, 1, "sum(Sales)",	"Formel: SUM(Sales)"
Booking, Anzahl Bestellungen,	2,  "COUNT(DISTINCT OrderID)", "Formel: COUNT(DISTINCT OrderID)"
Booking, #Bestellmenge, 3, sum(Quantity), "Formel: Sum(Quantity)"
Customers, 	Anzahl Kunden, 4, "COUNT(DISTINCT CustomerID)", "Formel: COUNT(DISTINCT Customer)"
];

///$tab Automatisch generierter Abschnitt
Set dataManagerTables = '','Categories','Employees','Office','Products','Wortliste','Territories','Bundesländer','Shippers','Suppliers','Customers','Auftragspositionen','Auftragskopf';
//This block renames script tables from non generated section which conflict with the names of managed tables

For each name in $(dataManagerTables) 
    Let index = 0;
    Let currentName = name; 
    Let tableNumber = TableNumber(name); 
    Let matches = 0; 
    Do while not IsNull(tableNumber) or (index > 0 and matches > 0)
        index = index + 1; 
        currentName = name & '-' & index; 
        tableNumber = TableNumber(currentName) 
        matches = Match('$(currentName)', $(dataManagerTables));
    Loop 
    If index > 0 then 
            Rename Table '$(name)' to '$(currentName)'; 
    EndIf; 
Next; 
Set dataManagerTables = ;


Unqualify *;

__cityAliasesBase:
LOAD
	Alias AS [__City],
	geoKey AS [__geoKey],
	CountryCode AS [__CityCountryCode]
FROM [lib://AttachedFiles/cityAliases.qvd]
(qvd);

__cityGeoBase:
LOAD
	geoKey AS [__geoKey],
	geoPoint AS [__GeoPoint]
FROM [lib://AttachedFiles/cityGeo.qvd]
(qvd);

__countryGeoBase:
LOAD
	ISO3Code AS [__ISO3Code],
	ISO2Code AS [__ISO2Code],
	Polygon AS [__Polygon]
FROM [lib://AttachedFiles/countryGeo.qvd]
(qvd);

__countryAliasesBase:
LOAD
	Alias AS [__Country],
	ISO3Code AS [__ISO3Code]
FROM [lib://AttachedFiles/countryAliases.qvd]
(qvd);

__cityName2Key:
MAPPING LOAD
	__City,
	__geoKey
RESIDENT __cityAliasesBase;

__cityKey2GeoPoint:
MAPPING LOAD
	__geoKey,
	__GeoPoint
RESIDENT __cityGeoBase;

__countryCodeIsoTwo2Polygon:
MAPPING LOAD
	__ISO2Code,
	__Polygon
RESIDENT __countryGeoBase;

__countryCodeAndCityName2Key:
MAPPING LOAD
	__CityCountryCode & __City,
	__geoKey
RESIDENT __cityAliasesBase;

__countryCodeIsoTwo2IsoThree:
MAPPING LOAD
	__ISO2Code,
	__ISO3Code
RESIDENT __countryGeoBase;

__countryName2IsoThree:
MAPPING LOAD
	__Country,
	__ISO3Code
RESIDENT __countryAliasesBase;

__countryCodeIsoThree2Polygon:
MAPPING LOAD
	__ISO3Code,
	__Polygon
RESIDENT __countryGeoBase;

[Categories]:
LOAD [CategoryID],
	[CategoryName],
	[Description]
 FROM [lib://Source Vertriebsdemo (qtsel_bzw)/Categories.csv]
(txt, codepage is 1252, embedded labels, delimiter is ';', msq);

[Employees]:
LOAD [EmployeeID],
	[ParentID],
	[Salesman]
 FROM [lib://Source Vertriebsdemo (qtsel_bzw)/Employees.csv]
(txt, codepage is 28591, embedded labels, delimiter is ';', msq);

[Office]:
LOAD 
	[Office] as Niederlassung,
	[SalesOffice],
	APPLYMAP( '__cityKey2GeoPoint', APPLYMAP( '__cityName2Key', LOWER([SalesOffice])), '-') AS [Office.SalesOffice_GeoInfo];
LOAD [Office],
	[SalesOffice]
 FROM [lib://Source Vertriebsdemo (qtsel_bzw)/Office.csv]
(txt, codepage is 28591, embedded labels, delimiter is ';', msq);

[Products]:
LOAD [CategoryID],
	[ProductID],
	[ProductName],
	[SupplierID]
 FROM [lib://Source Vertriebsdemo (qtsel_bzw)/Products.csv]
(txt, codepage is 28591, embedded labels, delimiter is '\t', msq);

[Wortliste]:
LOAD [EintragNr],
	[D],
	[EN],
	[ES]
 FROM [lib://Source Vertriebsdemo (qtsel_bzw)/Wortliste.csv]
(txt, codepage is 1252, embedded labels, delimiter is '\t', msq);

[Territories]:
LOAD 
	[Land] AS [Territories.Land],
	[BundeslandID],
	[EmployeeID],
	[TerritoryID],
	APPLYMAP( '__countryCodeIsoTwo2Polygon', UPPER([Land]), '-') AS [Territories.Land_GeoInfo],
	[Land]&[BundeslandID] AS [Territories.KeyTerBL],
	[Land]&[BundeslandID] AS [Territories.KeyTerBL_1],
	[Land]&[BundeslandID] AS [Territories.KeyTerCust],
	[Land]&[BundeslandID] AS [Territories.KeyBLTer],
	[Land]&[BundeslandID] AS [Territories.KeyCustTer],
	[Land]&[BundeslandID] AS [KeyTerCust],
	[Land]&[BundeslandID] AS [KeyBuTer];
LOAD [Land],
	[BundeslandID],
	[EmployeeID],
	[TerritoryID]
 FROM [lib://Source Vertriebsdemo (qtsel_bzw)/Territories.csv]
(txt, codepage is 28591, embedded labels, delimiter is ';', msq);

[Bundesländer]:
LOAD 
	[Land] AS [Bundesländer.Land],
	[Bundesland],
	[BundeslandID] AS [Bundesländer.BundeslandID],
	//[Einwohner],
	//[Fläche (km²)],
	//[Hauptstadt],
	APPLYMAP( '__countryCodeIsoTwo2Polygon', UPPER([Land]), '-') AS [Bundesländer.Bundesländer.Land_GeoInfo],
	//APPLYMAP( '__cityKey2GeoPoint', APPLYMAP( '__countryCodeAndCityName2Key', APPLYMAP( '__countryCodeIsoTwo2IsoThree', UPPER([Land])) & LOWER([Hauptstadt])), '-') AS [Bundesländer.Hauptstadt_GeoInfo],
	[Land]&[BundeslandID] AS [Bundesländer.KeyTerBL],
	[Land]&[BundeslandID] AS [Bundesländer.KeyBLTer],
	[Land]&[BundeslandID] AS [KeyBuTer];
LOAD [Land],
	[Bundesland],
	[BundeslandID]
	//[Einwohner],
	//[Fläche (km²)],
	//[Hauptstadt]
 FROM [lib://Source Vertriebsdemo (qtsel_bzw)/Bundesländer.csv]
(txt, codepage is 28591, embedded labels, delimiter is ';', msq);

[Shippers]:
LOAD [Shipper],
	[ShipperID]
 FROM [lib://Source Vertriebsdemo (qtsel_bzw)/Shippers.csv]
(txt, codepage is 28591, embedded labels, delimiter is ';', msq);

[Suppliers]:
LOAD 
	[SupplierID],
	[Supplier],
	[Contact],
	[Country],
	[City],
	APPLYMAP( '__countryCodeIsoThree2Polygon', APPLYMAP( '__countryName2IsoThree', LOWER([Country])), '-') AS [Suppliers.Country_GeoInfo],
	APPLYMAP( '__cityKey2GeoPoint', APPLYMAP( '__countryCodeAndCityName2Key', APPLYMAP( '__countryName2IsoThree', LOWER([Country])) & LOWER([City])), '-') AS [Suppliers.City_GeoInfo];
LOAD [SupplierID],
	[Supplier],
	[Contact],
	[Country],
	[City]
 FROM [lib://Source Vertriebsdemo (qtsel_bzw)/Suppliers.csv]
(txt, codepage is 28591, embedded labels, delimiter is ';', msq);

[Customers]:
LOAD 
	[CustomerID],
	[Customer],
	[Land] AS [Customers.Land],
	[BundeslandID] AS [Customers.BundeslandID],
	[PLZ],
	[Ort],
	[Kontaktperson],
	[Niederlassung],
	APPLYMAP( '__countryCodeIsoTwo2Polygon', UPPER([Land]), '-') AS [Customers.Land_GeoInfo],
	APPLYMAP( '__cityKey2GeoPoint', APPLYMAP( '__countryCodeAndCityName2Key', APPLYMAP( '__countryCodeIsoTwo2IsoThree', UPPER([Land])) & LOWER([Ort])), '-') AS [Customers.Ort_GeoInfo],
	[Land]&[BundeslandID] AS [KeyTerCust];
LOAD [CustomerID],
	[Customer],
	[Land],
	[BundeslandID],
	[PLZ],
	[Ort],
	[Kontaktperson],
	[Niederlassung]
// FROM [lib://Source Vertriebsdemo/Customers.csv]
 FROM [lib://Source Vertriebsdemo (qtsel_bzw)/Customers.csv]
(txt, codepage is 28591, embedded labels, delimiter is ';', msq);

[Auftragspositionen]:
LOAD 
	[COS],
	[Discount],
	[GP],
	[OrderID],
	[ProductID],
	[Quantity],
	[sales] AS [Sales];
LOAD [COS],
	[Discount],
	[GP],
	[OrderID],
	[ProductID],
	[Quantity],
	[sales]
 FROM [lib://Source Vertriebsdemo (qtsel_bzw)/Auftragspositionen.qvd]
(qvd);

[Auftragskopf]:
LOAD [OrderID],
	[Freight],
	[OrderDate],
	[ShipperID],
	[CustomerID],
	[Status],
	[RequiredDate] as "Geplantes Lieferdatum",
	[DeliveryDate] as "Tatsächliches Lieferdatum",
    if(Floor([DeliveryDate]) - Floor([RequiredDate])>0,1,0) as NotOnTime,
    if(Floor([DeliveryDate]) - Floor([RequiredDate])>1,1,0) as NotDeliveredReliably,//liefertreu, wenn Tatsächliches Lieferdatum mehr als einen Tag zu spät ist.
	[CalcCurrentYTD],
	[CalcPreviousYTD],
	[OrderIDCount]
FROM [lib://Source Vertriebsdemo (qtsel_bzw)/Auftragskopf_2018.xlsx]
(ooxml, embedded labels, table is Auftragskopf_2018);
// FROM [lib://Source Vertriebsdemo/Auftragskopf.csv]
//FROM [lib://Source Vertriebsdemo/Auftragskopf.csv]
//(txt, codepage is 28591, embedded labels, delimiter is ';', msq);

TAG FIELD [SalesOffice] WITH '$geoname', '$relates_Office.SalesOffice_GeoInfo' ;
TAG FIELD [Office.SalesOffice_GeoInfo] WITH '$geopoint', '$hidden', '$relates_SalesOffice' ;
TAG FIELD [Territories.Land] WITH '$geoname', '$relates_Territories.Land_GeoInfo' ;
TAG FIELD [Territories.Land_GeoInfo] WITH '$geopolygon', '$hidden', '$relates_Territories.Land' ;
TAG FIELD [Bundesländer.Land] WITH '$geoname', '$relates_Bundesländer.Bundesländer.Land_GeoInfo' ;
TAG FIELD [Bundesländer.Bundesländer.Land_GeoInfo] WITH '$geopolygon', '$hidden', '$relates_Bundesländer.Land' ;
TAG FIELD [Hauptstadt] WITH '$geoname', '$relates_Bundesländer.Hauptstadt_GeoInfo' ;
TAG FIELD [Bundesländer.Hauptstadt_GeoInfo] WITH '$geopoint', '$hidden', '$relates_Hauptstadt' ;
TAG FIELD [Country] WITH '$geoname', '$relates_Suppliers.Country_GeoInfo' ;
TAG FIELD [Suppliers.Country_GeoInfo] WITH '$geopolygon', '$hidden', '$relates_Country' ;
TAG FIELD [City] WITH '$geoname', '$relates_Suppliers.City_GeoInfo' ;
TAG FIELD [Suppliers.City_GeoInfo] WITH '$geopoint', '$hidden', '$relates_City' ;
TAG FIELD [Customers.Land] WITH '$geoname', '$relates_Customers.Land_GeoInfo' ;
TAG FIELD [Customers.Land_GeoInfo] WITH '$geopolygon', '$hidden', '$relates_Customers.Land' ;
TAG FIELD [Ort] WITH '$geoname', '$relates_Customers.Ort_GeoInfo' ;
TAG FIELD [Customers.Ort_GeoInfo] WITH '$geopoint', '$hidden', '$relates_Ort' ;

DROP TABLES __cityAliasesBase, __cityGeoBase, __countryGeoBase, __countryAliasesBase;
[autoCalendar]: 
  DECLARE FIELD DEFINITION Tagged ('$date')
FIELDS
  Dual(Year($1), YearStart($1)) AS [Year] Tagged ('$axis', '$year'),
  Dual('Q'&Num(Ceil(Num(Month($1))/3)),Num(Ceil(NUM(Month($1))/3),00)) AS [Quarter] Tagged ('$quarter', '$cyclic'),
  Dual(Year($1)&'-Q'&Num(Ceil(Num(Month($1))/3)),QuarterStart($1)) AS [YearQuarter] Tagged ('$yearquarter', '$qualified'),
  Dual('Q'&Num(Ceil(Num(Month($1))/3)),QuarterStart($1)) AS [_YearQuarter] Tagged ('$yearquarter', '$hidden', '$simplified'),
  Month($1) AS [Month] Tagged ('$month', '$cyclic'),
  Dual(Year($1)&'-'&Month($1), monthstart($1)) AS [YearMonth] Tagged ('$axis', '$yearmonth', '$qualified'),
  Dual(Month($1), monthstart($1)) AS [_YearMonth] Tagged ('$axis', '$yearmonth', '$simplified', '$hidden'),
  Dual('W'&Num(Week($1),00), Num(Week($1),00)) AS [Week] Tagged ('$weeknumber', '$cyclic'),
  Date(Floor($1)) AS [Date] Tagged ('$axis', '$date', '$qualified'),
  Date(Floor($1), 'D') AS [_Date] Tagged ('$axis', '$date', '$hidden', '$simplified'),
  If (DayNumberOfYear($1) <= DayNumberOfYear(Today()), 1, 0) AS [InYTD] ,
  Year(Today())-Year($1) AS [YearsAgo] ,
  If (DayNumberOfQuarter($1) <= DayNumberOfQuarter(Today()),1,0) AS [InQTD] ,
  4*Year(Today())+Ceil(Month(Today())/3)-4*Year($1)-Ceil(Month($1)/3) AS [QuartersAgo] ,
  Ceil(Month(Today())/3)-Ceil(Month($1)/3) AS [QuarterRelNo] ,
  If(Day($1)<=Day(Today()),1,0) AS [InMTD] ,
  12*Year(Today())+Month(Today())-12*Year($1)-Month($1) AS [MonthsAgo] ,
  Month(Today())-Month($1) AS [MonthRelNo] ,
  If(WeekDay($1)<=WeekDay(Today()),1,0) AS [InWTD] ,
  (WeekStart(Today())-WeekStart($1))/7 AS [WeeksAgo] ,
  Week(Today())-Week($1) AS [WeekRelNo] ;

DERIVE FIELDS FROM FIELDS [OrderDate], [Geplantes Lieferdatum], [Tatsächliches Lieferdatum] USING [autoCalendar] ;
